            "text": "[[[\"гадюка\",\"asp\",,,0],[,,\"gadyuka\",\"asp\"]],[[\"noun\",[\"аспид\",\"гадюка\",\"випера\",\"змея\"],[[\"аспид\",[\"asp\",\"viper\",\"schist\",\"slate\"],,0.012588142],[\"гадюка\",[\"viper\",\"adder\",\"asp\"],,0.012392981],[\"випера\",[\"viper\",\"asp\"]],[\"змея\",[\"snake\",\"serpent\",\"viper\",\"asp\",\"ophidian\"]]],\"asp\",1],[\"abbreviation\",[\"по возможности скорее\",\"при первой возможности\"],[[\"по возможности скорее\",[\"asp\"]],[\"при первой возможности\",[\"asp\"]]],\"asp\",6]],\"en\",,,[[\"asp\",1,[[\"гадюка\",1000,true,false],[\"ASP\",0,true,false],[\"жерех\",0,true,false],[\"осина\",0,true,false],[\"жереха\",0,true,false]],[[0,3]],\"asp\",0,1]],0.83501005,,[[\"en\"],,[0.83501005]],,,,,[[[\"‘He had a heart of gold, but he also had a tongue as sharp as a Gillette razor and a bite every bit as venomous as the \\u003cb\\u003easp\\u003c/b\\u003e that bit Cleopatra,’ he said.\",,,,3,\"m_en_us1223287.002\"],[\"Have we, as a Nation, in our liberality, clasped an \\u003cb\\u003easp\\u003c/b\\u003e to our collective bosom.\",,,,3,\"m_en_us1223287.001\"],[\"Antony committed suicide while Cleopatra took the \\u003cb\\u003easp\\u003c/b\\u003e .\",,,,3,\"m_en_us1223287.002\"],[\"Thus animals could be seen as the embodiments of evil, like the \\u003cb\\u003easp\\u003c/b\\u003e of Macarius of Alexandria.\",,,,3,\"m_en_us1223287.001\"],[\"If you were rotten, you might be a vole or an \\u003cb\\u003easp\\u003c/b\\u003e or a dung beetle.\",,,,3,\"m_en_us1223287.001\"],[\"But, he mused: ‘I feel that I may be taking an \\u003cb\\u003easp\\u003c/b\\u003e to my bosom.’\",,,,3,\"m_en_us1223287.001\"],[\"The Egyptian queen clutches the \\u003cb\\u003easp\\u003c/b\\u003e with a frightening tenacity, while the naked object of Zeus's golden shower grasps the coins from Olympus as one who fully understands the terms of the consummation being visited upon her.\",,,,3,\"m_en_us1223287.002\"],[\"The story of the \\u003cb\\u003easp\\u003c/b\\u003e , and of the suicide note, not only proclaimed Octavian's innocence: it gilded him with honour.\",,,,3,\"m_en_us1223287.001\"],[\"You would think after Eve's shenanigans in the Garden of Eden and Cleopatra's mishap with her \\u003cb\\u003easp\\u003c/b\\u003e , we would have learned by now.\",,,,3,\"m_en_us1223287.002\"],[\"Cleopatra, fallen into Caesar's power but determined not to grace his triumph, takes her own life by the bite of an \\u003cb\\u003easp\\u003c/b\\u003e .\",,,,3,\"m_en_us1223287.002\"],[\"In the basket is an \\u003cb\\u003easp\\u003c/b\\u003e , a very poisonous snake which kills painlessly.\",,,,3,\"m_en_us1223287.002\"],[\"You try not to be seen, yet you snap out unexpectedly like a hidden \\u003cb\\u003easp\\u003c/b\\u003e .\",,,,3,\"m_en_us1223287.001\"],[\"Tragedy and romance have never been so irresistibly entwined: the beautiful young queen, maddened by grief, hastening to join her dead lover, Mark Antony, through the kiss of an \\u003cb\\u003easp\\u003c/b\\u003e .\",,,,3,\"m_en_us1223287.002\"],[\"Stretched out seductively on her cushion at Wolf's right elbow, she resembled an \\u003cb\\u003easp\\u003c/b\\u003e in greenery.\",,,,3,\"m_en_us1223287.001\"],[\"This doesn't sound too appetizing to Cleo, and she has an \\u003cb\\u003easp\\u003c/b\\u003e - a rather poisonous snake - brought to her hidden in a basket of figs.\",,,,3,\"m_en_us1223287.002\"],[\"She would not live this way, so history says she had an \\u003cb\\u003easp\\u003c/b\\u003e , which was an Egyptian cobra, brought to her hidden in a basket of figs.\",,,,3,\"m_en_us1223287.002\"],[\"In his play Antony and Cleopatra, Cleopatra is delivered a basket of figs containing an \\u003cb\\u003easp\\u003c/b\\u003e , the venomous snake that ultimately causes her death.\",,,,3,\"m_en_us1223287.002\"],[\"Soon after Shirley Temple committed suicide by stinging herself with an \\u003cb\\u003easp\\u003c/b\\u003e 's venom and her sadness was mirrored by thousands across the world.\",,,,3,\"m_en_us1223287.001\"],[\"A clown enters her chamber before she is to be taken away by Caesar, bringing a basket of figs in which there is a poisonous \\u003cb\\u003easp\\u003c/b\\u003e which Cleopatra uses to kill herself.\",,,,3,\"m_en_us1223287.002\"],[\"A rustic, who engages the Queen in quibbling banter, brings \\u003cb\\u003easps\\u003c/b\\u003e concealed in a basket of figs.\",,,,3,\"m_en_us1223287.002\"],[\"Surely the worst \\u003cb\\u003easps\\u003c/b\\u003e in this world are the ones one has clasped to the bosom.\",,,,3,\"m_en_us1223287.001\"],[\"Overseas they have a mixture of cobras, vipers, \\u003cb\\u003easps\\u003c/b\\u003e and snake types that we don't have here, that produce quite different effects.\",,,,3,\"m_en_us1223287.001\"]]]]"
